import logo from './logo.svg';
import './assets/css';


function HelloWord(name, years) {
   return (
        <div>
            <h2> Hola soy { name } </h2>
            <h3>Tengo {years} a√±os</h3>
        </div> 
   )
}

function App() {
    return ( <
        div className = "App" >
        <
        header className = "App-header" >
        <img src = { logo }
        className = "App-logo"
        alt = "logo"/>

        <p>
        BIENVENIDOS {HelloWord("Daniel Rubiano", 29)}
        </p> <a className = "App-link"
        href = "https://reactjs.org"
        target = "_blank"
        rel = "noopener noreferrer" >
        Learn React </a> </header> </div>
    );
}

export default App;
